import React, { Component } from 'react';
import './App.css';
import "antd/dist/antd.css";
import {Route,BrowserRouter} from "react-router-dom";


class App extends Component {
  render() {

    return (
        <BrowserRouter>
          <Route path="/"/>
        </BrowserRouter>
    );
  }
}

export default App;
